import "../styles.css";
import TodoApp from "../containers/TodoApp";
import Login from "../containers/Login";

export default function App({ auth }) {
  return (
    <div className="App">
      {!auth.token && <Login />}
      {auth.token && <TodoApp />}
    </div>
  );
}
